import React from "react";

const Dashboard = () => (
  <section className="bg-white rounded shadow p-4">
    <h2 className="text-xl font-semibold mb-2">Dashboard</h2>
    <ul>
      <li>Total Clients: <span className="font-bold">--</span></li>
      <li>Pending Invoices: <span className="font-bold">--</span></li>
      <li>Upcoming Meetings: <span className="font-bold">--</span></li>
    </ul>
  </section>
);

export default Dashboard;
